	$icd10Query=imw_query("select * from icd10_data group by icd9 order by icd10 asc");
	if(imw_error())$err.='<br/>'.imw_error();
	while($icd10Data=imw_fetch_object($icd10Query))
	{
		$Icd10[$icd10Data->icd9]=$icd10Data->id;
	}
	//$icd10Query.close;
	
	//create ICD9 Array
	$cid9Query=imw_query("SELECT * FROM  `diagnosis_tbl` ");
	if(imw_error())$err.='<br/>'.imw_error();
	while($icd9data=imw_fetch_object($cid9Query))
	{
		list($code,$descr)=explode(', ',$icd9data->diag_code);
		$Icd9[$icd9data->diag_id]=$code;	
	}
	//$cid9Query.close;
	
	$query=imw_query("select id,dx_id,dx_id_default from surgeonprofileprocedure where dx_id!='' or dx_id_default!=''");
	if(imw_error())$err.='<br/>'.imw_error();
	while($data=imw_fetch_object($query))
	{
		if($data->dx_id)
		{
			$dx_arr=explode(',',$data->dx_id);
			foreach($dx_arr as $diag_id)
			{
				if($Icd9[$diag_id])//get icd 9 code
				{
					if($Icd10[$Icd9[$diag_id]])//get icd10
					{
						$icd10_ids[]=$Icd10[$Icd9[$diag_id]];	
					}
				}
			}
		}
		
		if($data->dx_id_default)
		{
			$dx_default_arr=explode(',',$data->dx_id_default);
			foreach($dx_default_arr as $diag_default_id)
			{
				if($Icd9[$diag_default_id])//get icd 9 code
				{
					if($Icd10[$Icd9[$diag_default_id]])//get icd10
					{
						$icd10_default_ids[]=$Icd10[$Icd9[$diag_default_id]];	
					}
				}
			}
		}
		
		$dx_id_icd10=implode(',',$icd10_ids);
		$dx_id_default_icd10=implode(',',$icd10_default_ids);
		imw_query("update surgeonprofileprocedure set dx_id_icd10='$dx_id_icd10',dx_id_default_icd10='$dx_id_default_icd10' where id='$data->id'");
		if(imw_error())$err.='<br/>'.imw_error();
		unset($dx_id_icd10, $dx_id_default_icd10, $icd10_ids, $icd10_default_ids);
